import React, { useState } from "react";
import { Link, useNavigate, useParams, useLocation } from "react-router-dom";
import "./DogRunPage.css";
import Dogrun from "../assets/images/Dogrun/dogrun.png";

const options = ["駐車場あり", "人工芝生", "天然芝生", "利用料金無料", "営業24時間", "大型犬OK"];

// 型定義の追加
type Prefecture = { name: string; count: number };
type Region = { name: string; prefectures?: Prefecture[] };

const regions: {[key: string] : Region } = {
  hokkaidoTohoku: {
    name: "北海道・東北",
  },
  kanto: {
    name: "関東",
  },
  hokuriku: {
    name:"北陸",
  },
  chubu: {
    name:"中部",
  },
  kinki:{ 
    name: "近畿",
  },
  chugoku: {
    name: "中国",
    prefectures: [
    { name: "滋賀県",count: 62},
    { name: "京都府",count: 62},
    { name: "大阪府",count: 62},
    { name: "兵庫県",count: 62},
    { name: "奈良県",count: 62},
    { name: "和歌山県",count: 62},
  ],
  },
  shikoku: {
    name: "四国",
    prefectures: [
    { name: "徳島県",count: 62},
    { name: "香川県",count: 62},
    { name: "愛媛県",count: 62},
    { name: "高知県",count: 62},
    ],
  },
  kyushu: {
    name: "九州",
    prefectures: [
     {name: "福岡県",count: 62},
     {name: "佐賀県",count: 62},
     {name: "長崎県",count: 62},
     {name: "熊本県",count: 62},
     {name: "大分県",count: 62},
     {name: "宮崎県",count: 62},
     {name: "鹿児島県",count: 62},
    ],
  },
  okinawa: {
    name: "沖縄",
    prefectures: [
      {name: "沖縄県",count: 62},
    ],
  },
};

// 都道府県別の詳細ページのロジックを含むコンポーネント
const DogRunDetailPage: React.FC = () => {
  const { prefecture } = useParams<{ prefecture: string }>(); // URLから都道府県を取得
  const navigate = useNavigate();
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search); // クエリパラメータを取得
  const [selectedOptions, setSelectedOptions] = useState<string[]>([]);
  const displayPrefecture = (prefecture && prefecture in regions) 
  ? regions[prefecture as keyof typeof regions].name 
  : prefecture;

  const handleOptionClick = (option: string) => {
    setSelectedOptions((prevSelected) =>
      prevSelected.includes(option)
        ? prevSelected.filter((item) => item !== option)
        : [...prevSelected, option]
    );
  };

  const handleSearch = () => {
    if (selectedOptions.includes("駐車場あり") && selectedOptions.includes("人工芝生")) {
      navigate(`/dogrun/${prefecture}/parking-artificial-grass`);
    }
  };

  const hasParking = queryParams.get("parking") === "true";
  const grassType = queryParams.get("grass") === "true";

  return (
    <div className="dogrun-detail-page">
      <header className="header">
        <Link to="/" style={{ textDecoration: "none", color: "black" }}>
          wan paradise
        </Link>
      </header>
      <h1>ドッグラン</h1>
      <h2>{displayPrefecture}</h2>
      <div className="conditions">
        <ul>
          {hasParking && <li>駐車場あり</li>}
          {grassType && <li>人工芝生</li>}
        </ul>
      </div>
      <div className="options-container">
        {options.map((option) => (
          <button
            key={option}
            onClick={() => handleOptionClick(option)}
            className={selectedOptions.includes(option) ? "selected" : ""}
          >
            {option}
          </button>
        ))}
      </div>
      <button onClick={handleSearch}>検索</button>
    </div>
  );
};

// 都道府県選択メインページ
const DogRunPage: React.FC = () => {
  const [isDropdownVisible, setIsDropdownVisible] = useState(false);
  const navigate = useNavigate();

  const toggleDropdown = () => {
    setIsDropdownVisible(!isDropdownVisible);
  };

  const handlePrefectureClick = (regionKey: string, prefectureName: string) => {
    navigate(`/dogrun/${regionKey}/${prefectureName}`);
  };

  return (
    <div className="dogrun-page">
      <header className="header">wan paradise</header>
      <div className="tab-container" onClick={toggleDropdown}>
        <span>全国のドッグランを探す</span>
        <div className="dogrun-img">
          <img src={Dogrun} alt="ドッグランのイラスト" className="dogrun-illust" />
        </div>
      </div>
      {isDropdownVisible && (
        <div className="dropdown-menu">
          {Object.keys(regions).map((regionKey) => {
            const region = regions[regionKey as keyof typeof regions];
            return (
              <div key={regionKey} className="region-section">
                <h2 className="region-title">{region.name}</h2>
                <ul className="prefecture-list">
                  {region.prefectures?.map((prefecture:{ name: string; count: number}) => (
                    <li
                      key={prefecture.name}
                      className="prefecture-item"
                      onClick={() => handlePrefectureClick(regionKey, prefecture.name)}
                    >
                      {prefecture.name} ({prefecture.count})
                    </li>
                  ))}
                </ul>
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
};

export { DogRunPage, DogRunDetailPage };
